import React,{Component} from 'react';

class PostCard extends Component{
    render(){
        return(
            <div className="post-card">
                <div className="post-head">
                    <p>Image</p>
                    <div className="name-desc">
                        <p>Sikandar</p>
                        <span>time</span>
                    </div>
                </div>
            </div>
        )
    }
}

export default PostCard;
